<?php

namespace Nasajon\Atendimento\AppBundle\Controller\Endpoint;

use FOS\RestBundle\Controller\Annotations as FOS;
use FOS\RestBundle\Controller\FOSRestController;
use Nasajon\Atendimento\AppBundle\Exception\MailRejectException;
use Nasajon\Atendimento\AppBundle\Service\MailReceiverService;
use Symfony\Component\HttpFoundation\JsonResponse;
use Symfony\Component\HttpFoundation\Request;

/**
 *
 */
class MailgunEndpointController extends FOSRestController {

    /**
     *     
     * @FOS\Post("/mailreceiver")
     */
    public function mailreceiverAction(Request $request) {

        try {
            $message = $request->request->all();

            $service = $this->get('nasajon_atendimento_app_bundle.mail_receiver_service');
            $service->process($message);

            return new JsonResponse();
        } catch (MailRejectException $e) {
            return new JsonResponse([], JsonResponse::HTTP_NOT_ACCEPTABLE);
        }
    }

